window.bookSummaryJSON = "<p><b>The cats are back!</b></p> <p>Her brief return to Earth is at an end, and Florence Valentine is ready to start rebuilding her dungeon.</p> <p>Florence and Doug have big plans for their new home, but all is not well in the world of Aerkon. A bargain struck with the lich Berikoz may cost her more than she realized, and it seems like everyone wants to see her new home destroyed.</p> <p>Liches, dungeon pests, evil adventurers, and powerful guilds stand against her, and Florence’s allies are few and far between. Will Florence, Doug, and her kitty defenders be strong enough to protect everything they’ve built?</p>"; 
